import axios from "axios";
import { render } from "nunjucks";
import React, { useEffect, useState } from "react";

const MTGSets = axios.get("https://api.scryfall.com/sets")
    .then(res => res.data.data)

const SetSelect = () => {
    const [draftSet, setDraftSet] = useState(MTGSets)

    return(
        <select>
            {
             MTGSets
             .map(sets => <option key={sets.id}>{draftSet}</option>
             )
            }
        </select>
    )
}

export default SetSelect
